import React from 'react'
import styled from '@emotion/styled'
import Auth from "./Auth";

const Navbar = styled.div`
    height: 10vh;
    display: flex;
    background-color: #2a2f32;
    position: fixed;
    width: 100%;
`

const Logo = styled.h1`
    flex: 1;
    margin: 20px;
    color: white;
`

const Header = ({ isIn }) => {
    return(
        <Navbar>
            <Logo>🍒🔥</Logo>
            <Auth isIn={isIn}/>
        </Navbar>
    );
}

export default Header;
